import Profile from './components/Profile';

const Example = () => {
  return (
    <>
      <h3>練習問題</h3>

      <ul>
        <Profile name='Geo' age='18' hobbies={['spoerts', 'music']} />
        <Profile name='Tom' age='25' hobbies={['movie', 'music']} />
        <Profile name='Lisa' age='21' hobbies={['sports', 'travel', 'game']} />
      </ul>
    </>
  );
};

export default Example;
